__NUXT_JSONP__("/svet/mesto/runavik", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p){return {data:[{place:[{id:g,id_state:h,name:i,population:3145,area:8.2,altitude:0,slug:j,information_chatgpt:"\u003Cp\u003ERunavík je malé město ležící na ostrově Eysturoy ve Faerských ostrovech. S přibližně 4 000 obyvateli je to jedno z významných středisek v této oblasti. Město je známé svou krásnou přírodou, okouzlujícím pobřežím a historickými památkami.\u003C\u002Fp\u003E\n\u003Cp\u003EJedním z hlavních symbolů Runavíku je jeho přístav, který slouží jako významný dopravní uzel a centrum rybolovu. Kromě toho je zde také moderní loděnice, která je důležitou součástí místního průmyslu. Pro milovníky přírody nabízí pobřeží a okolní krajina mnoho možností k procházkám, pěší turistice a piknikům.\u003C\u002Fp\u003E\n\u003Cp\u003EV samotném městě si můžete prohlédnout několik zajímavých památek. Jednou z nich je kostel Runavíkurkirkja, který je zasvěcen svatému Magnusovi. Tato kamenná stavba pochází z roku 1917 a je považována za architektonický skvost. Další pamětihodností je Stará škola, historická budova z roku 1892, která dnes slouží jako kulturní centrum a muzeum.\u003C\u002Fp\u003E\n\u003Cp\u003EPro sportovní nadšence je Runavík ideálním místem k vyzkoušení různých aktivit. Zdejší fotbalový stadion, nazvaný Runavík Stadium, je domovským hřištěm místního fotbalového klubu, který soutěží v nejvyšší faerské fotbalové lize. Město také nabízí vybavené sportovní centrum s bazénem a fitness zařízeními.\u003C\u002Fp\u003E\n\u003Cp\u003EV blízkosti Runavíku se nacházejí další zajímavá místa, která stojí za návštěvu. Například nedaleko se rozkládá vesnice Saltangará, známá pro své malebné přístaviště a tradiční rybářské domky. Lze také navštívit město Tórshavn, hlavní město Faerských ostrovů, které se nachází asi 30 minut jízdy od Runavíku.\u003C\u002Fp\u003E\n\u003Cp\u003ERunavík je fascinující destinací, která láká návštěvníky svým přírodním a historickým bohatstvím. Jeho malebné prostředí, pohostinnost obyvatel a různorodé možnosti zábavy a odpočinku z něj činí skvělé místo pro dovolenou i objevování nových kultur.\u003C\u002Fp\u003E",coordinates:[{latitude:62.0602,longitude:-6.7517}],biggest:"yes",type_place:c,id_image_cover:a,id_image_hero:a,affiliate:[{name:k,value:l}],alerts:a,zoom:[{google:10,booking:11}]}],placeState:[{id:h,tld:".fo",name:"Faerské ostrovy",area:1399,population:48863,slug:m,id_continent:d,information_chatgpt:"\u003Cp\u003EFaerské ostrovy jsou malý ostrovní stát nacházející se mezi Norskem a Islandem v Atlantském oceánu. Tvoří je 18 ostrovů a mají rozlohu pouze 1 399 km². Hlavním městem a největším městem je Tórshavn, který se nachází na ostrově Streymoy. Ostrovy jsou známé svou krásnou přírodou, především fjordy, vodopády a horské vrcholy.\u003C\u002Fp\u003E\n\u003Cp\u003EFaerské ostrovy nabízejí mnoho možností pro turisty, kteří si chtějí užít krásy přírody. Oblast je velmi oblíbená mezi turisty, kteří hledají odpočinek od městského života a chtějí se vrátit k přírodě. Návštěvníci mohou vyzkoušet různé outdoorové aktivity jako jsou pěší túry, cyklistiku, rybaření nebo plavání.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě přírodních krás jsou Faerské ostrovy také známé pro své kulturní dědictví. Tórshavn má mnoho historických budov a muzeí, kde návštěvníci mohou zjistit více o historii a kultuře ostrovů. Místní obyvatelé se také pyšní svými tradičními tanci a písněmi, které jsou vystupovány při mnoha kulturních akcích a slavnostech.\u003C\u002Fp\u003E\n\u003Cp\u003EPro cestování po Faerských ostrovech je nejlepší způsob dopravy autem, protože to umožňuje návštěvníkům pohodlně se dostat na většinu míst ostrovů. Turisté si mohou také pronajmout lodě nebo jet na výlety lodí, aby si užili scenérie z blízka.\u003C\u002Fp\u003E\n\u003Cp\u003EJe důležité mít na paměti, že Faerské ostrovy jsou poměrně odlehlou oblastí, a proto se turisté musí připravit na omezené možnosti ubytování a služeb. Nicméně, pro ty, kteří hledají klid a přírodu, jsou Faerské ostrovy skvělým místem pro návštěvu.\u003C\u002Fp\u003E",currency_code:"DKK",currency_name:"dánská koruna",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:e,date_update:b},{name:"Policie",value:e,date_update:b},{name:"Hasiči",value:e,date_update:b},{name:"Zdravotnická záchranná služba",value:e,date_update:b}],phone_prefix:"+298",coordinates:[{latitude:"62.0097",longitude:"-6.7716"}],people_religion:[{name:"Luterská církev Faerských ostrovů",value:"80%"},{name:"Ostatní křesťané",value:"9%"},{name:"Bez vyznání",value:"6%"},{name:"Neuvedeno",value:"5%"}],people_nationality:[{name:"Faerané",value:"98.5%"},{name:"jiní",value:"1.5%"}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup na Faerské ostrovy občanský průkaz nestačí. Je potřeba mít platný cestovní pas.",date_update:b},{name:"Cestovní pas",value:"Pro vstup na Faerské ostrovy je potřeba mít platný cestovní pas.",date_update:b},{name:"Vízum",value:"Pro občany Evropské unie není potřeba žádné vízum pro vstup na Faerské ostrovy. Pokud však plánujete pobyt déle než 3 měsíce, může být nutné si zažádat o povolení k pobytu. Pro občany mimo Evropskou unii a Šengenský prostor je často potřeba vízum.",date_update:b},{name:"Očkování",value:"Pro vstup na Faerské ostrovy není nutné mít žádné speciální očkování. Nicméně, jako vždy, je doporučeno být očkován proti běžným chorobám jako jsou tetanus, záškrt, či hepatitida A a B.",date_update:b},{name:"Cestovní pojištění",value:"Pro vstup na Faerské ostrovy není nutné mít cestovní ani zdravotní pojištění. Nicméně, vzhledem k tomu, že lékařská péče na Faerských ostrovech může být velmi drahá, doporučuje se mít uzavřeno cestovní pojištění s krytím lékařských nákladů.",date_update:b},{name:"Bezpečnostní situace",value:"Faerské ostrovy jsou obecně považovány za bezpečné místo pro návštěvu. Kriminalita a terorismus jsou na velmi nízké úrovni. Nicméně, při cestování v přírodě je důležité dbát opatrnosti a dodržovat základní bezpečnostní opatření.",date_update:b},{name:"Další informace",value:"Při návštěvě Faerských ostrovů je dobré si vzít s sebou dostatek peněz, jelikož bankomaty jsou poměrně řídké a ne všechny přijímají zahraniční karty. Dále je dobré si přibalit vhodné oblečení a obuv, neboť počasí na ostrovech může být velmi proměnlivé. Většina obyvatel Faerských ostrovů mluví plynně anglicky, takže komunikace by neměla být příliš problémová.",date_update:b}],type_place:n,id_image_cover:f,id_image_hero:f,id_city_main:o,affiliate:[{name:k,value:l}],mpz:"FO",alerts:a,zoom:[{google:7,booking:8}],ids_neighboring_countries:a}],placeContinent:[{id:d,slug:"evropa",name:"Evropa",area:10180000,population:746000000,population_density:73.22,number_states:44,information_chatgpt:"\u003Cp\u003EEvropa je druhým nejmenším kontinentem na světě, ale zároveň se jedná o jednu z nejvíce rozmanitých oblastí na planetě. Nachází se zde mnoho historických a kulturních památek, překrásných přírodních scenérií a mnoho dalších atrakcí, což z ní dělá jednu z nejnavštěvovanějších turistických destinací na světě.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa má dlouhou a bohatou historii. Na kontinentě se odehrály mnohé důležité události, jako například římská říše, středověké křížové výpravy, renesance, průmyslová revoluce a dvě světové války. Tato historie se odráží v architektuře, muzeích a dalších kulturních památkách, které jsou na kontinentu k vidění.\u003C\u002Fp\u003E\n\u003Cp\u003EV Evropě se nachází mnoho zajímavých měst. Například Paříž, Londýn, Řím, Barcelona, Praha, Berlín a Amsterdam jsou velmi oblíbenými cíli turistů. Tyto města nabízejí nejen historické památky, ale také vynikající kuchyni, noční život a mnoho možností pro nákupy.\u003C\u002Fp\u003E\n\u003Cp\u003EPřírodní krása Evropy je také úžasná. Nachází se zde krásné pláže, hory, řeky a jezera. Alpské hory nabízejí překrásné scenérie, skvělé podmínky pro lyžování a další outdoorové aktivity. Národní parky, jako třeba Plitvická jezera v Chorvatsku, Krkonošský národní park v České republice nebo Národní park Durmitor v Černé Hoře, jsou dalšími příklady nádherných přírodních scenérií, které stojí za návštěvu.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa také nabízí širokou škálu kulturních aktivit. Existují zde mnohé umělecké festivaly, výstavy, divadelní představení a koncerty, které jsou pořádány po celém kontinentu. Mnoho měst také pořádá tradiční slavnosti a jarmarky, kde se můžete seznámit s místními tradicemi a kulturou.\u003C\u002Fp\u003E\n\u003Cp\u003EPři návštěvě Evropy si určitě nenechte ujít místní kuchyni. Každá země má své vlastní speciality a chuťě\u003C\u002Fp\u003E\u003Cp\u003EMezi nejznámější evropské kuchyně patří italská, francouzská a španělská. Italská kuchyně je známá svými těstovinami, pizzou a zmrzlinou. Francouzská kuchyně nabízí širokou škálu různých pokrmů, jako například sýry, pečivo, maso a víno. Španělská kuchyně je známá svými tapas, paellou a sangriou. Kromě těchto kuchyní jsou v Evropě také velmi oblíbené pokrmy jako německé klobásy, anglické snídaně, holandský sýr a mnoho dalšího.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa také nabízí mnoho možností pro sportovní aktivity. Mezi nejpopulárnější sporty patří fotbal, hokej, tenis a cyklistika. Na kontinentu se také nachází mnoho golfových hřišť, lyžařských středisek a dalších sportovních zařízení. V posledních letech se stále více lidí zajímá o ekoturistiku, a tak se nabízí možnost podniknout pěší túru nebo cyklistický výlet a objevovat krásy evropské přírody.\u003C\u002Fp\u003E\n\u003Cp\u003EEvropa je jedním z nejlepších míst pro cestování, nabízí mnoho možností pro každého cestovatele. Díky rozmanitosti kontinentu si každý najde to svoje, co ho zaujme. Záleží pouze na vás, zda si zvolíte kulturní zážitky, přírodní krásy, sportovní aktivity nebo si jen tak užijete místní kuchyni a pohodu.\u003C\u002Fp\u003E",coordinates:[{latitude:47.497912,longitude:19.040235}],type_place:"continent",id_image_cover:d,id_image_hero:d,zoom:[{google:p,booking:p}]}],placesCities:[{id:712,id_image_cover:a,slug:"fuglafjorour",type_place:c,name:"Fuglafjørður"},{id:709,id_image_cover:a,slug:"klaksvik",type_place:c,name:"Klaksvík"},{id:715,id_image_cover:a,slug:"kollafjorour",type_place:c,name:"Kollafjørður"},{id:g,id_image_cover:a,slug:j,type_place:c,name:i},{id:716,id_image_cover:a,slug:"saltangara",type_place:c,name:"Saltangará"},{id:717,id_image_cover:a,slug:"skali",type_place:c,name:"Skáli"},{id:714,id_image_cover:a,slug:"sorvagur",type_place:c,name:"Sørvágur"},{id:711,id_image_cover:a,slug:"tvoroyri",type_place:c,name:"Tvøroyri"},{id:o,id_image_cover:a,slug:"torshavn",type_place:c,name:"Tórshavn"},{id:713,id_image_cover:a,slug:"vagur",type_place:c,name:"Vágur"}],videos:[],posts:[],imagePlace:a,imageState:[{id:f,name:m,source:"\u002Fworld\u002Fstates\u002F",date_create:"2023-05-02T18:49:47.851894+00:00",type:n,author:"pixabay.com"}],imagesCities:a,imagesVideos:a,imagesPosts:a}],fetch:{"OrganismsoPlaceTeaserSpotsComponent:0":{spots:[],images:a},"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:void 0}}(null,"05-2023","city",4,"112",244,710,74,"Runavík","runavik","booking",true,"faerske-ostrovy","state",708,3)));